function toggleContainerClassAndHideButton(t,e){toggleContainerClass(t),hideButton(e),lazyLoad(t)}function toggleContainerClass(t){document.getElementById(t).className+=" active"}function hideButton(t){t.parentNode.className+=" hidden"}function lazyLoad(t){for(var e=document.getElementById(t).getElementsByTagName("img"),n=0;n<e.length;n++)e[n].getAttribute("data-src")&&e[n].setAttribute("src",e[n].getAttribute("data-src"))}